function fromGeoJSON(geoJSONstr) {
  let deduceDate = function(preDate) {
    let postDate = preDate;
    if (typeof preDate === "number") {
      postDate = new Date(preDate).toISOString();//aqui check that interpreter matches this string
    }
    return postDate;
  }
  let geoJSON = JSON.parse(geoJSONstr);
  let result = [];
  if (geoJSON.features) {
    console.log(geoJSON.features[0]);
    result = geoJSON.features.map(feature => {
      if (feature.geometry && feature.geometry.type === "Point") {
        let packet = {
          HOME: [],
          GPS: [],
          DATE: new Date().toISOString()
        };
        if (feature.properties) {
          for (let elt in feature.properties) {
            if (elt.toUpperCase() === "TIMESTAMP" || elt.toUpperCase() === "TIMES" || elt.toUpperCase() === "TIME" || elt.toUpperCase() === "FEATURECOORDTIMES" || elt.toUpperCase() === "COORDTIMES") {
              let date;
              if (typeof feature.properties[elt] === "object" && feature.properties[elt].length > 0) {
                packet.DATE = deduceDate(feature.properties[elt][0]);
              } else {
                packet.DATE = deduceDate(feature.properties[elt]);
              }
            } else if (elt.toUpperCase() === "HOME") {
              if (typeof feature.properties[elt] === "object") {
                packet.HOME = feature.properties[elt];
              }
            } else if (elt.toUpperCase() === "HOME_LONGITUDE") {
                packet.HOME[0] = feature.properties[elt];
            } else if (elt.toUpperCase() === "HOME_LATITUDE") {
                packet.HOME[1] = feature.properties[elt];
            } else if (elt.toUpperCase() === "HOME_ELEVATION" || elt.toUpperCase() === "HOME_ALTITUDE") {
                packet.HOME[2] = feature.properties[elt];
            } else {
              packet[elt] = feature.properties[elt];
            }
          }
        }
        if (feature.geometry.coordinates) {
          if (Array.isArray(feature.geometry.coordinates)) {
            if (feature.geometry.coordinates.length > 0) packet.GPS[0] = feature.geometry.coordinates[0];
            if (feature.geometry.coordinates.length > 1) packet.GPS[1] = feature.geometry.coordinates[1];
            if (feature.geometry.coordinates.length > 2) packet.GPS[2] = feature.geometry.coordinates[2];
          }
        }
        return packet;
      }
    });
    result = result.filter(n => n != undefined);
    console.log(result[0]);
  } else if (geoJSON.type === "Feature" && geoJSON.geometry && geoJSON.geometry.coordinates) {
    for (let i=0; i<geoJSON.geometry.coordinates.length; i++) {
      let packet = {
        GPS: [],
        DATE: new Date().toISOString()
      };
      packet.GPS = geoJSON.geometry.coordinates[i];
      if (geoJSON.properties) {
        let dateLocation = null;
        if (geoJSON.properties["timestamp"]) {
          dateLocation = geoJSON.properties["timestamp"];
        } else if (geoJSON.properties["times"]) {
          dateLocation = geoJSON.properties["times"];
        } else if (geoJSON.properties["time"]) {
          dateLocation = geoJSON.properties["time"];
        } else if (geoJSON.properties["featureCoordTimes"]) {
          dateLocation = geoJSON.properties["featureCoordTimes"];
        } else if (geoJSON.properties["coordTimes"]) {
          dateLocation = geoJSON.properties["coordTimes"];
        }
        if (dateLocation) packet.DATE = new Date(dateLocation[i]).toISOString();
      }
      result.push(packet);
    }
  } else {
    console.log("nothing found");
  }
  console.log(geoJSON.type);

  var fs = require('fs');
fs.writeFile("provaa.json", JSON.stringify(result), function(err) {
    if(err) {
        return console.log(err);
    }

    console.log("The file was saved!");
});

  return result;
}

